import { DashboardComponent } from './pages/components/dashboard/dashboard.component';
import { DepartmentComponent } from './pages/components/department/department.component';

@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    SideComponent,
    FooterComponent,
    MobileHeaderComponent,
    SubHeaderComponent,
    HomeComponent,
    QuickPanelComponent,
    ChatComponent,
    DemoPanelComponent,
    DashboardComponent,
    DepartmentComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
    FormsModule,
    FullCalendarModule 
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
